import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Preco from './components/precard/preco'; // Importe os componentes necessários
import Lamula from './components/precard/lamula';
import Nav from './components/navbar/Navbar'

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Preco />} />
        <Route path="/lamula" element={<Lamula />} />
      </Routes>
    </Router>
  );
}

export default App;
